body.div:
			1185 τίς ἄρα νέατος: ὁ χορὸς πάλιν καθʼ ἑαυτὸν γενόμενος ἐν ἀναλογισμῷ
                            γίνεται καί φησι, τίς ἄρα ἡμῖν ὁ ἔσχατος τῶν ἐτῶν ἀριθμὸς τῶν
                            πολυπλάγκτων;

			 ὅτι πρὸς βασιλίδα· τὸ δὲ χ ὅτι τὸ ὧδε τοπικόν. ὡς εἰκὸς κάτω νένευκεν ὁ
                            Λίχας· κατασχοῦσα οὖν αὐτὸν τῆς χειρός φησιν, ἀπόβλεψον εἰς ἐμέ· ὁ δὲ
                            ἀνανεύσας ἔφη, πρὸς τίνα γὰρ νομίζεις με βλέπειν;

			1001 τίς γὰρ ἀοιδός: τίς, φησίν, ἐπῳδὸς ἢ ἰατρὸς διὰ χειρῶν τὴν τέχνην
                            τῆς ἰατρικῆς ἐνδεικνύμενος θεραπεύσει τὸ πάθος μου εἰ μὴ ὁ Ζεὺς
                            βούλοιτο;

			ὃς ἤδη μετʼ οὐδενός: τὸ ἑξῆς, ὅς ἤδη ἐνθάδε ὀλοῦμαι μετʼ οὐδενὸς ὕστερον
                            ἀνδρὸς εἰσοπίσω τάλας ναίων· ὁ δὲ νοῦς, ἄρα ἐγὼ δύστηνος ἐνταῦθα
                            ἀπολοῦμαι ἀνθρώπων κεχωρισμένος;

			117 ὅρα, τίς ἄρʼ ἦν;: ὁ χορὸς ἐκ τῶν ἐπιχωρίων ἀνδρῶν πεπυσμένος ὅτι
                            προσκαθέζεταί τις τῷ ἱερῷ τόπῳ τούτῳ τὰ πρῶτα ὑποχαλεπαίνοντές φησι, τίς
                            ἄρα ἐστὶν ἢ ποῦ διατρίβει;

			1679 τί γάρ; ὅτῳ μήτʼ Ἄρης: πρὸς τὸ ἄνω, τί γάρ ἐστιν εἰκονίσαι ἐκείνῳ
                            πάνυ ᾧ τινι μήτε πόλεμος μήτε νόσος ἐπῆλθεν ἀλλʼ ἀφανῶς διὰ χάσματος
                            ἀπολομένῳ;
